import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

import './App.css';
import image from './images/images.png';
import logo1 from './images/Unknown.png';
import logo2 from './images/UNKNOWN-2.png';
import logo3 from './images/UNKNOWN-3.png';
import logo4 from './images/Unknown-4.png';
import Txt from "./bodyText";

function App() {

    const knowMore = () => {
      return (
        <div>
            <button className='button'
                //        onClick={() => alert("Yes!")}
            >
                <Link to="/">Back</Link>
                <i className="fa fa-arrow-left"></i>
            </button>
        </div>
      );
    };

  return (
      <div className='centre'>
        <head>
        </head>
          <body>
          <header>
              <h1 className='h1'>Trusted by Industry Leading Organisations</h1>
              <div className='img'>
                  <img src={image} className='img-fit' />
                  <img src={logo1} className='img-fit' />
                  <img src={logo2} className='img-fit' />
                  <img src={logo3} className='img-fit' />
              </div>
          </header>
          <div className='body'>
              <div className='img-border-div'>
                  <img src={logo4} className='img-border'/>
              </div>
              <div className='body-text'>
                <div className='body-text-div'>
                    <Router>
                        <Switch>
                            <Route path = '/' component = {bodyContent()} exact={true}>
                                <Txt />
                            </Route>
                            <Route path = '/know_more'>
                                <knowMore />
                            </Route>
                        </Switch>
                    </Router>
                </div>

              </div>
          </div>
          <div className='msg-button'>
              <button onClick={() => alert("message")} className={'button button-round'}>
                  <i className="fa fa-comments-o"></i>
              </button>
          </div>
          </body>
      </div>
  );
}

export default App;
